    return (
        <div className="playingCards">
            <div className={`card rank-${props.card.rank} ${props.card.suit} card_position`}>
                <span className="rank">{props.card.rank}</span>
                <span className="suit">&spades;</span>
            </div>

        </div>
    );
  }

export default Card
